import { useLinking } from "@react-navigation/native";
import { Linking } from "expo";

export default function (containerRef) {
  return useLinking(containerRef, {
    prefixes: [Linking.makeUrl("/")],
    config: {
      Auth: {
        path: "auth",
        screens: {
          LogIn: "login",
          SignUp: "signup",
        },
      },
      Root: {
        path: "root",
        screens: {
          Main: {
            path: "main",
            screens: {
              Jobs: {
                path: "emplois",
                screens: {
                  List: {
                    path: "emplois",
                  },
                  Read: {
                    path: "emplois/:id",
                  },
                  Post: {
                    path: "emplois/poster",
                  },
                },
              },
              People: {
                path: "annuaire",
                screens: {
                  List: {
                    path: "annuaire",
                  },
                  Read: {
                    path: "annuaire/:item._id",
                  },
                },
              },
              Messages: {
                path: "messagerie",
                screens: {
                  Lobby: {
                    path: "messagerie",
                  },
                  Room: {
                    path: "messagerie/:title",
                  },
                },
              },
            },
          },
          Profile: {
            path: "mon-profil",
            Read: {
              path: "mon-profil",
            },
            Edit: {
              path: "mon-profil/modifier",
            },
          },
          MyJobs: {
            path: "mon-offres",
            Read: {
              path: "mon-offres",
            },
            Edit: {
              path: "mon-offres/:id",
            },
          },
        },
      },
    },
  });
}
